/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import "./Header.css";

type HeaderProps = {
  className: string;
  withLogo?: boolean;
  header?:string;
};

export const Header: React.FC<HeaderProps> = ({
  className,
  withLogo = false,
  header,
}: HeaderProps) => {
  let name: string = "header flex " + className;
  return (
    <div className="header-wrapper">
    <div className="overlay" />
    <div className={name}>
      {withLogo && (
        <img src="./images/mother-changing-minds-black.png" className="logo" />
      )}
      {header && (
      <h1 className="flex">{header}</h1>
      )}
    </div>
    </div>
  );
};
